import React from 'react';
import PropTypes from 'prop-types';

PostsList.propTypes = {
    posts : PropTypes.array,
};
PostsList.defaultProps = {
    posts : []
}
function PostsList(props) {
    const {posts} = props
    return (
        <div>
            <ul>
                {posts.map(post=>(
                    <li key={posts.id}>{posts.title}</li>
                ))}
            </ul>
        </div>
    );
}

export default PostsList;
